import React from 'react';
import { Router } from '@reach/router';

import Octicon, { Beaker, MarkGithub } from '@primer/octicons-react';
import {
    Navbar, Button, Divider, Menu, Alignment, Classes, Colors
} from '@blueprintjs/core';

import cn from 'classnames';
import { siteWidth } from '../constants';

const DiagonalSeperator = ({ reversed, height, width, colorTop = Colors.BLACK,
    colorBottom = Colors.DARK_GRAY2, className = '', ...props
}) => (
    <div className={cn('separator', className, { reversed })} {...props}>
        <style jsx>{`
            .separator {
                width: 0;
                height: 0;
                border-style: solid;
                border-width: ${height}vh ${width}vw 0 0;
                border-color: ${colorTop} ${colorBottom} ${colorBottom} ${colorBottom};
            }

            .reversed.separator {
                border-width: ${height}vh 0 0 ${width}vw;
            }
        `}</style>
    </div>
);

const Flex = ({ children, className, ...props }) => (
    <div className={cn(className, 'flex')} {...props}>
        {children}
        
        <style jsx>{`
            margin: 0;
            min-width: 0;

            display: flex;
            flex-direction: row;
        `}</style>
    </div>
);

const Container = ({ children, className, ...props }) => (
    <div className={cn(className, 'container')} {...props}>
        {children}
        
        <style jsx>{`
            .container {
                width: 100%;
                margin: 0 auto;
                max-width: ${siteWidth};
            }
        `}</style>
    </div>
);

const Home = () => (<>
    <Flex style={{ height: '100vh', backgroundColor: Colors.BLACK }}
        className={Classes.DARK}
    >
        <Container style={{ paddingBottom: '4em', alignSelf: 'center' }}>
            <h1 className='hero-header'>
                Vote your <span className='hero-highlight'>mind</span>
            </h1>
        </Container>

        <style jsx>{`
            .hero-header {
                margin: 0;
                font-size: 5em;
                text-align: center;
            }

            .hero-highlight {
                color: ${Colors.BLUE1};
            }

            @media (min-width: ${siteWidth}) {
                .hero-header {
                    font-size: 7.5em;
                }
            }
        `}</style>
    </Flex>
</>);

const Lab = () => (
    <p>
        This is the lab
    </p>
);

const App = () => (
    <Router>
        <Home path='/' />
        <Lab path='/lab' />
    </Router>
);

export default App;
